import SHOP_DATA from "../../pages/Shop/Shop.data";
import { setShopCollections } from "./shop.action";
const INITAIL_STATE = {
  collections: SHOP_DATA,
};

const shopReducer = (state = INITAIL_STATE, action) => {
  switch (action.type) {
    default:
      return state;
  }
};

export default shopReducer;
